export class DominionWarUniformPack extends BaseTngEraUniformPack implements IUniformPack {

    getUniformSwatches() {
        return [
            new Swatch(BodyType.AverageMale, "Average Male", (token) => UniformCatalog.decorateSwatch(DominionWarMaleBody, BodyType.AverageMale, token), "BodyType.averageMale"),
            new Swatch(BodyType.AverageFemale, "Average Female", (token) => UniformCatalog.decorateSwatch(DominionWarFemaleBody, BodyType.AverageFemale, token), "BodyType.averageFemale"),
        ];
    }

    getUniformVariantSwatches(token: Token) {
        return [];
    }

    getUniformAndVariantBody(token: Token) {
        let seam = "";
        if (token.bodyType === BodyType.AverageMale) {
            if (token.species === Species.Bolian) {
                seam = DominionWarMaleBodyBolianRidge;
            }
            return (DominionWarMaleBody + seam).replace(DefaultRed, token.divisionColor).replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
        } else {
            if (token.species === Species.Bolian) {
                seam = DominionWarFemaleBodyBolianRidge;
            }
            return (DominionWarFemaleBody + seam).replace(DefaultRed, token.divisionColor).replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
        }
    }
}